import React, { useState, useEffect } from 'react';
import './AquaponicsInfoCard.css';
import deviceImage from './assets/device-image.png'; // –ò–º–ø–æ—Ä—Ç–∏—Ä—É–µ–º –∏–∑–æ–±—Ä–∞–∂–µ–Ω

const AQUAPONICS_FACTS = [
  "–†—ã–±–∫–∏ –≤ –∞–∫–≤–∞–ø–æ–Ω–∏–∫–µ –ø—Ä–æ–∏–∑–≤–æ–¥—è—Ç –ø–∏—Ç–∞—Ç–µ–ª—å–Ω—ã–µ –≤–µ—â–µ—Å—Ç–≤–∞ –¥–ª—è —Ä–∞—Å—Ç–µ–Ω–∏–π!",
  "–†–∞—Å—Ç–µ–Ω–∏—è –æ—á–∏—â–∞—é—Ç –≤–æ–¥—É –¥–ª—è —Ä—ã–±–æ–∫ - –∏–¥–µ–∞–ª—å–Ω—ã–π —Å–∏–º–±–∏–æ–∑!",
  "–ê–∫–≤–∞–ø–æ–Ω–∏–∫–∞ –∏—Å–ø–æ–ª—å–∑—É–µ—Ç –Ω–∞ 90% –º–µ–Ω—å—à–µ –≤–æ–¥—ã, —á–µ–º —Ç—Ä–∞–¥–∏—Ü–∏–æ–Ω–Ω–æ–µ –∑–µ–º–ª–µ–¥–µ–ª–∏–µ!",
  "–¢–∏–ª–∞–ø–∏—è –∏ –∫–∞—Ä–ø—ã –∫–æ–∏ - —Å–∞–º—ã–µ –ø–æ–ø—É–ª—è—Ä–Ω—ã–µ —Ä—ã–±—ã –¥–ª—è –∞–∫–≤–∞–ø–æ–Ω–∏–∫–∏!",
  "–ó–µ–ª–µ–Ω—å –≤ –∞–∫–≤–∞–ø–æ–Ω–∏–∫–µ —Ä–∞—Å—Ç–µ—Ç –≤ 2 —Ä–∞–∑–∞ –±—ã—Å—Ç—Ä–µ–µ, —á–µ–º –≤ –ø–æ—á–≤–µ!",
  "–ë–∞–∑–∏–ª–∏–∫, —Å–∞–ª–∞—Ç –∏ –∫–ª—É–±–Ω–∏–∫–∞ - –ª—É—á—à–∏–µ —Ä–∞—Å—Ç–µ–Ω–∏—è –¥–ª—è –∞–∫–≤–∞–ø–æ–Ω–∏–∫–∏!",
  "–ò–¥–µ–∞–ª—å–Ω–∞—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä–∞ –≤–æ–¥—ã: 22-26¬∞C –¥–ª—è —Ä—ã–± –∏ —Ä–∞—Å—Ç–µ–Ω–∏–π!",
  "–ê–∫–≤–∞–ø–æ–Ω–∏–∫–∞ –∏–º–∏—Ç–∏—Ä—É–µ—Ç –µ—Å—Ç–µ—Å—Ç–≤–µ–Ω–Ω—ã–µ –≤–æ–¥–Ω—ã–µ —ç–∫–æ—Å–∏—Å—Ç–µ–º—ã!",
  "–í–æ–¥–∞ –≤ —Å–∏—Å—Ç–µ–º–µ —Ü–∏—Ä–∫—É–ª–∏—Ä—É–µ—Ç –ø–æ—Å—Ç–æ—è–Ω–Ω–æ, —Å–æ–∑–¥–∞–≤–∞—è –∏–¥–µ–∞–ª—å–Ω—ã–µ —É—Å–ª–æ–≤–∏—è!",
  "–ù–µ—Ç –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ—Å—Ç–∏ –≤ —Ö–∏–º–∏—á–µ—Å–∫–∏—Ö —É–¥–æ–±—Ä–µ–Ω–∏—è—Ö - –≤—Å–µ –Ω–∞—Ç—É—Ä–∞–ª—å–Ω–æ!"
];

const FISH_ICONS = ['üêü', 'üê†', 'ü¶ê', 'üê°'];
const PLANT_ICONS = ['üå±', 'üåø', 'üçÄ', '‚òòÔ∏è'];

const AquaponicsInfoCard = ({ deviceId }) => {
  const [currentFact, setCurrentFact] = useState('');
  const [fishImage, setFishImage] = useState(FISH_ICONS[0]);
  const [plantImage, setPlantImage] = useState(PLANT_ICONS[0]);

  const updateFactAndIcons = () => {
    setCurrentFact(AQUAPONICS_FACTS[Math.floor(Math.random() * AQUAPONICS_FACTS.length)]);
    setFishImage(FISH_ICONS[Math.floor(Math.random() * FISH_ICONS.length)]);
    setPlantImage(PLANT_ICONS[Math.floor(Math.random() * PLANT_ICONS.length)]);
  };

  useEffect(() => {
    updateFactAndIcons();
    const factInterval = setInterval(updateFactAndIcons, 30000);
    return () => clearInterval(factInterval);
  }, []);

  return (
    <div className="aquaponics-card">
      <div className="device-info-section">
        <div className="device-image-container">
          <img 
            src={deviceImage} 
            alt="–ê–∫–≤–∞–ø–æ–Ω–∏—á–µ—Å–∫–∞—è —Å–∏—Å—Ç–µ–º–∞" 
            className="device-image"
          />
        </div>
        <h3>–°–∏—Å—Ç–µ–º–∞ #{deviceId}</h3>
        <div className="status-indicator">
          <span className="status-dot"></span>
          <span>–ê–∫—Ç–∏–≤–Ω–∞</span>
        </div>
      </div>
      
      <div className="fact-section">
        <div className="icons-row">
          <span className="icon">{fishImage}</span>
          <span className="icon">{plantImage}</span>
        </div>
        <div className="fact-text">
          <h4>–ó–Ω–∞–µ—Ç–µ –ª–∏ –≤—ã?</h4>
          <p>{currentFact}</p>
        </div>
      </div>
    </div>
  );
};

export default AquaponicsInfoCard;
